import { LoginPage } from './login';
import { Quizcustompage } from './quicklogin';

function App() {
  return (
    <div className="App bg-amber-100 border-solid border-2 h-[100vh] w-screen ">
     <Quizcustompage />
     <LoginPage />
    </div>
  );
}

export default App;
